import copy
import time


class Sudoku(object):
	# pass in 0 as a blank list and modify after
	def __init__(self, data):
		self.array = copy.deepcopy(data)
		self.original = copy.deepcopy(data)
		self.clean()
		self.starttime = float('inf')


	def __str__(self):
		string = f'solved in {time.time() - self.starttime} seconds\n'
		string += 'original sudoku\n'
		for i in self.original:
			string += str(i) + '\n'
		string += 'solved sudoku\n'
		for i in self.array:
			string += str(i) + '\n'
		return string.strip()



	def clean(self):
		for c in range(9):
			for b in range(9):
				if self.original[c][b] == [1, 2, 3, 4, 5, 6, 7, 8, 9]:
					self.original[c][b] = 0


	def solved(self):
		solv = True
		for r1 in range(9):
			for c1 in range(9):
				if type(self.array[r1][c1]) == list:
					solv = False

		return solv


	def contradiction(self):
		for row in range(9):
			for column in range(9):
				if self.array[row][column] == []:
					return True

		return False


	def verify(self, array):
		Flag = True
		for rew in range(9):
			for col in range(9):
				if type(array[rew][col]) != int:
					Flag = False
					return Flag

		self.array = copy.deepcopy(array)
		return Flag


	def removeitemincolumns(self, row, columns):
		for r in range(9):
			if r != row and type(self.array[r][columns]) != list and\
			self.array[r][columns] in self.array[row][columns]:
				self.array[row][columns].remove(self.array[r][columns])


	def removeiteminrows(self, row, columns):
		for c in range(9):
			if c != columns and type(self.array[row][c]) != list and \
			self.array[row][c] in self.array[row][columns]:
				self.array[row][columns].remove(self.array[row][c])


	def remove3x3(self, row, columns):
		rowblock = [i for i in range(row // 3 * 3, 3 + row // 3 * 3)]
		columnblock = [i for i in range(columns // 3 * 3, 3 + columns // 3 * 3)]
		for r in rowblock:
			for c in columnblock:
				if type(self.array[r][c]) != list and (r != row or c != columns) and\
				self.array[r][c] in self.array[row][columns]:
					self.array[row][columns].remove(self.array[r][c])


	def guess(self):
		if self.starttime > time.time():
			self.starttime = time.time()

		self.simplify()

		if not self.contradiction():
			temp = copy.deepcopy(self.array)

		else:
			return

		if self.verify(temp) or self.verify(self.array):
			return

		else:
			for row in range(9):
				for column in range(9):
					if type(self.array[row][column]) == list:
						for gue in self.array[row][column]:
							self.array = copy.deepcopy(temp)
							self.array[row][column] = gue
							self.guess()
							if self.solved():
								return

						return

		self.array = temp


	def simplify(self):
		solved = False
		while not solved:
			hung = True
			for row1 in range(9):
				for col1 in range(9):
					if type(self.array[row1][col1]) == list:
						self.removeiteminrows(row1, col1)
						self.removeitemincolumns(row1, col1)
						self.remove3x3(row1, col1)
						if len(self.array[row1][col1]) == 1:
							hung = False
							self.array[row1][col1] = self.array[row1][col1][0]

			if hung:
				break

			solved = self.solved()


